import React from "react";
import Input from "../../../../ui/Input";
import Label from "../../../../ui/Label";

export default function FormElement({
  type,
  labelText,
  inputName,
  inputType,
  inputRequired
}) {
  let element = "";
  console.log(type);
  if ((type = "input")) {
    element = (
      <Input
        type={inputType}
        id={inputName}
        name={inputName}
        required={inputRequired}
      />
    );
  }
  return (
    <div className="FormElement">
      <Label htmlFor={inputName} text={labelText} />
      <span>{element}</span>
    </div>
  );
}
